package com.ufgov.zc.common.zc.model;public class ZCQuestion extends ZcEbQues {  /**   *    */  private static final long serialVersionUID = 1L;  private Integer sn;  private String quesId;  private String quesType;  private String state;  private String handleMode;  private String senuser;  private String dwFileName;  public ZCQuestion() {  }  public String getDwFileName() {    return dwFileName;  }  public void setDwFileName(String dwFileName) {    this.dwFileName = dwFileName;  }  public String getHandleMode() {    return handleMode;  }  public void setHandleMode(String handleMode) {    this.handleMode = handleMode;  }  public String getSenuser() {    return senuser;  }  public void setSenuser(String senuser) {    this.senuser = senuser;  }  public String getQuesType() {    return quesType;  }  public void setQuesType(String quesType) {    this.quesType = quesType;  }  public String getQuesId() {    return quesId;  }  public void setQuesId(String quesId) {    this.quesId = quesId;  }  public String getState() {    return state;  }  public void setState(String state) {    this.state = state;  }  public Integer getSn() {    return sn;  }  public void setSn(Integer sn) {    this.sn = sn;  }}